import React, { Component } from "react";
import { Button, Table, Container } from "reactstrap";
import socketIOClient from "socket.io-client";

class FlightSimulator extends Component {
    constructor() {
        super()
        this.state = {
            // future possible values include aot node values and state
            socket: socketIOClient("http://localhost:3001/")
        }
    }


    render() {
        return (
            <Container>
                <h2 className="h2Class">Flight Simulator</h2>
                <Table>
                    <thead>
                        <th>Dataflow Diagram</th>
                        <th>Output and Controls</th>
                    </thead>
                    <tbody>
                        <tr>
                            <td>
                                {DAG()}
                            </td>
                            <td>
                                <Table>
                                    <thead>Controls</thead>
                                    <tbody>
                                        <tr>
                                            <td>
                                                <Button onClick={() => console.log("UP!\n")}>UP</Button>
                                            </td>
                                            <td>
                                                <Button onClick={() => console.log("DOWN!\n")}>DOWN</Button>
                                            </td>
                                        </tr>
                                    </tbody>
                                </Table>
                            </td>
                        </tr>
                    </tbody>
                </Table>
            </Container>
        )
    }

}

class DAG extends Component {
    constructor() {
        super()
    }

    render() {
        return (
            <div></div>
        )
    }
}


export default FlightSimulator
